import React from 'react';

const ChooseTest = () => {
    return(
        <div>
            <h3>Which test are you gonna take?</h3>
            <input type="radio" value="ieltsacademic" name="test"/>
            <input type="radio" value="ieltsgeneral" name="test"/>
            <input type="radio" value="toelf" name="test"/>
            <button>Start</button>
        </div>
    )
}

export default ChooseTest;
